import { Cell } from '@ton/core';

import { loadConfig, updateConfig } from './configParser';

const configBase64 = ``;

const configCell = Cell.fromBase64(configBase64);

describe('Config Parser', () => {
    it('should update params', () => {
        const config = loadConfig(configCell);

        expect(config[8].anon0.version).toBe(10);

        const updatedConfigCell = updateConfig(configCell, {
            kind: 'ConfigParam__8',
            anon0: { kind: 'GlobalVersion', version: 99, capabilities: config[8].anon0.capabilities },
        });

        const updatedConfig = loadConfig(updatedConfigCell);
        expect(updatedConfig[8].anon0.version).toBe(99);
    });
});
